import React from "react";
import './Button.css';

const ButtonPlay = ({ click, titleBtn }) => {

    return   <div>
      <button
      type = "button"
      onClick={ click }>
     {titleBtn} 
     </button>
     </div>
   };

export default ButtonPlay;
